import React, { useEffect } from "react";
import { COLOR_LOGO_PRESETS, SETTINGS } from "../commons";

export const handler = ({ inputs, mechanic }) => {
  const { size, color, profile, border } = inputs;

  useEffect(() => {
    mechanic.done();
  }, []);

  return (
    <svg
      width={size}
      height={size}
      viewBox="0 0 300 300"
      fill={color}
      xmlns="http://www.w3.org/2000/svg"
    >
      {profile && DEFAULT(color, border)}
      {!profile && SQUARED(color)}
    </svg>
  );
};

export const inputs = {
  size: { type: "number", default: 500 },
  profile: { type: "boolean", default: true },
  border: { type: "boolean", default: true },
  color: { type: "color", model: "hex", default: "#FED", editable: false },
};

